$_MODULE['<{mbeshipping}prestashop>welcome_06acb34650df4917a32a707f41eb0994'] = 'Expédition et logistique numérisée avec MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_bd279c91483c0fd991bf0dd24082c847'] = 'Donnez un nouvel élan à votre e-commerce avec les solutions MBE de digitalisation des expéditions et de la logistique, conçues pour les entreprises, les entrepreneurs mais aussi les artisans qui recherchent un partenaire fiable pouvant les accompagner en réussissant la mise en ligne de leur activité avec des solutions complètes et flexibles. Vous êtes client MBE ? ';
$_MODULE['<{mbeshipping}prestashop>welcome_02d4482d332e1aef3437cd61c9bcc624'] = 'Contactez-nous';
$_MODULE['<{mbeshipping}prestashop>welcome_ee3ae8f2b909a448403a77ffbb3cb259'] = 'Démarrer la configuration';
$_MODULE['<{mbeshipping}prestashop>welcome_0d7545e6e62aa27411c09e133edba866'] = 'En connectant la plateforme MBE directement à votre site e-commerce, vous pouvez automatiser la gestion des expéditions et faciliter le processus de vente. ';
$_MODULE['<{mbeshipping}prestashop>welcome_461b35b457d9b9ba7ee9b502c377cc30'] = 'Solutions numériques MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_1bcd51908f4de69964082ee6a92fa697'] = 'Des services digitaux clés en main qui font décoller votre marque. Atteignez vos clients en ligne avec des solutions numériques et des outils de marketing Web qui vous donnent plus de chances d\'atteindre votre public en créant une présence en ligne efficace pour votre entreprise et en étant là où se trouvent vos clients. MBE vous propose des solutions efficaces pour développer vos canaux digitaux. Présentez votre marque, votre boutique en ligne ou améliorez votre site Web actuel pour le rendre plus visible sur les moteurs de recherche.';
$_MODULE['<{mbeshipping}prestashop>welcome_47e149951cc16a06badb305ea12b2dd5'] = 'Emballage MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_6efcae05527f34189a6799f27c0ae9bd'] = 'Le service d\'emballage qui donne un avantage à votre entreprise. Vos clients méritent une expérience unique : surprenez-les lors du déballage avec des solutions d\'emballage personnalisées pour vos produits. Une solution hautement personnalisée qui met en valeur votre marque et ajoute une touche de style en fonction de vos besoins spécifiques. En plus d\'optimiser le temps et les ressources, vous pouvez réduire votre impact environnemental car MBE utilise des techniques et des matériaux d\'emballage innovants.';
$_MODULE['<{mbeshipping}prestashop>welcome_7f59c0ca6fc8f4127ae2692ca2d363a5'] = 'Vous savez maintenant que vous avez un partenaire fiable à vos côtés !';
